hwMeta.bodyText:
If(st._eq(stT.idle),
    al_next(sda_chk & ~(sig_5 & sig_6 | sig_5 & sig_7 | sig_6 & sig_7) & ~sda_t | ~lastSda & (sig_5 & sig_6 | sig_5 & sig_7 | sig_6 & sig_7) & (sig_1 & sig_2 | sig_1 & sig_3 | sig_2 & sig_3) & ~cmd_stop)
).Else(
    al_next(sda_chk & ~(sig_5 & sig_6 | sig_5 & sig_7 | sig_6 & sig_7) & ~sda_t)
)

Switch(st)\
    .Case(stT.idle,
        If(al._eq(1),
            st_next(stT.idle)
        ).Elif(cntrl_cmd._eq(0),
            st_next(stT.idle)
        ).Elif(cntrl_cmd._eq(1),
            st_next(stT.start_0)
        ).Elif(cntrl_cmd._eq(2),
            st_next(stT.stop_0)
        ).Elif(cntrl_cmd._eq(4),
            st_next(stT.wr_0)
        ).Elif(cntrl_cmd._eq(3),
            st_next(stT.rd_0)
        ).Else(
            st_next(st)
        ))\
    .Case(stT.start_0,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.start_1)
        ))\
    .Case(stT.start_1,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.start_2)
        ))\
    .Case(stT.start_2,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.start_3)
        ))\
    .Case(stT.start_3,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.start_4)
        ))\
    .Case(stT.start_4,
        st_next(stT.idle))\
    .Case(stT.stop_0,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.stop_1)
        ))\
    .Case(stT.stop_1,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.stop_2)
        ))\
    .Case(stT.stop_2,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.stop_3)
        ))\
    .Case(stT.stop_3,
        st_next(stT.idle))\
    .Case(stT.rd_0,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.rd_1)
        ))\
    .Case(stT.rd_1,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.rd_2)
        ))\
    .Case(stT.rd_2,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.rd_3)
        ))\
    .Case(stT.rd_3,
        st_next(stT.idle))\
    .Case(stT.wr_0,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.wr_1)
        ))\
    .Case(stT.wr_1,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.wr_2)
        ))\
    .Case(stT.wr_2,
        If(al._eq(1),
            st_next(stT.idle)
        ).Else(
            st_next(stT.wr_3)
        ))\
    .Default(
        st_next(stT.idle))

If(clkCntr._eq(0) | (lastScl & ~(sig_1 & sig_2 | sig_1 & sig_3 | sig_2 & sig_3) & ~scl_t)._eq(1),
    clkCntr_next(clk_cnt_initVal._reinterpret_cast(Bits(16, signed=False))),
    stateClkEn_next(1)
).Elif(slave_wait._eq(1),
    stateClkEn_next(0),
    clkCntr_next(clkCntr)
).Else(
    clkCntr_next(clkCntr - 1),
    stateClkEn_next(0)
)

If(al._eq(1),
    cntrl_rd(0),
    sda_t_next(0),
    scl_t_next(0),
    sda_chk_next(0)
).Else(
    If(st._eq(stT.start_1) | st._eq(stT.start_2) | st._eq(stT.start_3) | st._eq(stT.stop_1) | st._eq(stT.stop_2) | st._eq(stT.stop_3) | st._eq(stT.rd_1) | st._eq(stT.rd_2) | st._eq(stT.wr_1) | st._eq(stT.wr_2),
        scl_t_next(0)
    ).Elif(st._eq(stT.start_4) | st._eq(stT.stop_0) | st._eq(stT.rd_0) | st._eq(stT.rd_3) | st._eq(stT.wr_0) | st._eq(stT.wr_3),
        scl_t_next(1)
    ).Else(
        scl_t_next(scl_t)
    ),
    If(st._eq(stT.start_0) | st._eq(stT.start_1) | st._eq(stT.stop_3) | st._eq(stT.rd_0) | st._eq(stT.rd_1) | st._eq(stT.rd_2) | st._eq(stT.rd_3),
        sda_t_next(0)
    ).Elif(st._eq(stT.start_2) | st._eq(stT.start_3) | st._eq(stT.start_4) | st._eq(stT.stop_0) | st._eq(stT.stop_1) | st._eq(stT.stop_2),
        sda_t_next(1)
    ).Elif(st._eq(stT.wr_0) | st._eq(stT.wr_1) | st._eq(stT.wr_2) | st._eq(stT.wr_3),
        sda_t_next(~cntrl_din)
    ).Else(
        sda_t_next(sda_t)
    ),
    cntrl_rd(st._eq(stT.start_4) | st._eq(stT.stop_3) | st._eq(stT.rd_3) | st._eq(stT.wr_3)),
    sda_chk_next(sda_chk)
)
